function setActiveTab(){var b=window.location.pathname;$(".nav-undertabs a").each(function(){var a=$(this).attr("href");a=a.substring(0,a.length-11);b.substring(0,a.length)===a&&($(this).addClass("nav-tabs"),$(this).addClass("active"))})}function selectListItem(){var b=window.location.pathname;$(".nav-list-group a").each(function(){var a=$(this).attr("href");b.includes(a)&&$(this).addClass("selected")})}$(function(){setActiveTab();selectListItem()});